	return (
		<div className={s.list}>
			{array.map((item, index) => {
				console.log(index + 1);
				console.log(colors.length);

				let step = (index * 1 + 1) / colors.length;
				console.log(step);

				return <HolidayCalendarItem />;
			})}
		</div>
	);
};

export default HolidayCalendarList;
